import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import Header from '../components/LoginHeader';

const storeLocations = [
  { id: 1, name: 'Store A', zipCode: '12345' },
  { id: 2, name: 'Store B', zipCode: '23456' },
  // Add more store locations here
  { id: 3, name: 'Store C', zipCode: '34567' },
  { id: 4, name: 'Store D', zipCode: '45678' },
  { id: 5, name: 'Store E', zipCode: '56789' },
  { id: 6, name: 'Store F', zipCode: '67890' },
  { id: 7, name: 'Store G', zipCode: '78901' },
  { id: 8, name: 'Store H', zipCode: '89012' },
  { id: 9, name: 'Store I', zipCode: '90123' },
  { id: 10, name: 'Store J', zipCode: '01234' }
];

function OrdersPage() {
  const location = useLocation();
  const navigate = useNavigate();
  const { orderDetails } = location.state || {};

  // Ensure orderDetails is valid and has expected properties
  if (!orderDetails || !orderDetails.cart || !orderDetails.confirmationNumber || !orderDetails.orderDate || !orderDetails.deliveryDate || !orderDetails.totalCost) {
    return <p>No order details available.</p>;
  }

  const { cart, confirmationNumber, orderDate, deliveryDate, totalCost, deliveryType, storeId, customerData } = orderDetails;

  // Convert totalCost to a number if it's not already
  const numericTotalCost = Number(totalCost);

  // Calculate if the delivery date is more than 5 days away
  const today = new Date();
  const deliveryDateObj = new Date(deliveryDate);
  const daysUntilDelivery = Math.ceil((deliveryDateObj - today) / (1000 * 60 * 60 * 24));

  // Handler for canceling the order
  const handleCancelOrder = () => {
    // Implement cancel order logic here
    alert('Order has been canceled');
    // Redirect or update state as needed
    navigate('/');
  };

  return (
    <div>
      <Header />
      <div className="orders-container">
        <h2>Order Details</h2>
        <p><strong>Confirmation Number:</strong> {confirmationNumber}</p>
        <p><strong>Order Date:</strong> {new Date(orderDate).toLocaleDateString()}</p>
        <p><strong>Delivery Date:</strong> {new Date(deliveryDate).toLocaleDateString()}</p>

        <div className="order-summary">
          <h3>Order Summary</h3>
          <ul>
            {cart.length > 0 ? (
              cart.map(item => (
                <li key={item.id} className="order-item">
                  <img 
                    src={item.image || 'default-image-url'} 
                    alt={item.name} 
                    style={{ width: '50px', height: '50px', marginRight: '10px' }} 
                  />
                  <span>{item.name} - {item.quantity} x ${item.price ? Number(item.price).toFixed(2) : '0.00'}</span>
                </li>
              ))
            ) : (
              <p>No items in the cart.</p>
            )}
          </ul>
          <h3><strong>Total:</strong> ${numericTotalCost.toFixed(2)}</h3>
        </div>

        {/* Delivery Option Details */}
        <div className="delivery-details">
          <h3>Delivery Information</h3>
          {deliveryType === 'storePickup' ? (
            <>
              <p><strong>Pickup Store:</strong> {storeLocations.find(store => store.id === storeId)?.name || 'Unknown Store'}</p>
              <p><strong>Store Zip Code:</strong> {storeLocations.find(store => store.id === storeId)?.zipCode || 'Unknown Zip Code'}</p>
            </>
          ) : (
            <>
              <p><strong>Delivery Address:</strong></p>
              <p>{customerData.name}</p>
              <p>{customerData.address}</p>
              <p>{customerData.city}, {customerData.state} {customerData.zipCode}</p>
            </>
          )}
        </div>

        {/* Cancel Order Option */}
        {daysUntilDelivery > 5 ? (
          <button className="cancel-order-btn" onClick={handleCancelOrder}>
            Cancel Order
          </button>
        ) : (
          <p>Orders can only be canceled if delivery is more than 5 days away.</p>
        )}
      </div>
    </div>
  );
}

export default OrdersPage;
